import React from 'react';
import { 
  Home, Folder, Play, Search, 
  Settings, HelpCircle 
} from 'lucide-react';
import SidebarItem from './SidebarItem';

const Sidebar = () => {
  return (
    <div className="w-64 bg-gray-900 text-white p-4 flex flex-col h-full">
      <div className="flex items-center mb-8">
        <img 
          src="/logo.png" 
          alt="TwoLabs Logo" 
          className="w-10 h-10 mr-2 rounded" 
        />
        <span className="font-bold text-lg">TwoLabs</span>
      </div>

      <button className="bg-green-600 text-white w-full py-2 rounded mb-6">
        + New
      </button>

      <nav className="space-y-2 flex-grow">
        <SidebarItem icon={Home} label="Overview" active />
        <SidebarItem icon={Folder} label="Indexes" />
        <SidebarItem icon={Play} label="Examples" />
      </nav>

      <nav className="border-t border-gray-700 pt-4 space-y-2">
        <SidebarItem icon={Search} label="Search" />
        <SidebarItem icon={Settings} label="Settings" />
        <SidebarItem icon={HelpCircle} label="Help" />
      </nav>
    </div>
  );
};

export default Sidebar;
